SELECT CODCOMUNA, JURISDICCION, INSTANCIA, ANODEMANDA, NROJUICIO, FECHATRAMITEJUIC, DESCRIPCION FROM M10ESTJU WHERE CODCOMUNA = 1 AND JURISDICCION BETWEEN 1 AND 9 AND INSTANCIA BETWEEN 1 AND 9 AND NROJUICIO BETWEEN 1 AND 99;
SELECT M.COD_COMUNA, M.COD_JURISDICCION AS INSTANCIA, M.COD_INSTANCIA AS JUZGADONRO, M.AÑO_DEMANDA, M.NRO_JUICIO, M.COD_SISTEMA, M.FECHA_DEMANDA, M.MONTO_INICIAL, M.TIPOJUICIO, M.CUIJ_J, J.DESCRIPCION, J.FECHATRAMITEJUIC FROM M10NAPLEG M LEFT JOIN M10ESTJU J ON J.CODCOMUNA = M.COD_COMUNA AND J.JURISDICCION = M.COD_JURISDICCION AND J.INSTANCIA = M.COD_INSTANCIA AND J.ANODEMANDA = M.AÑO_DEMANDA AND J.NROJUICIO = M.NRO_JUICIO LEFT JOIN M10TABCLA T ON T.COD_COMUNA = M.COD_COMUNA AND T.DESCRIPCION = M.COD_INSTANCIA AND T.ANODEMANDA = M.AÑO_DEMANDA AND T.NROJUICIO = M.NRO_JUICIO WHERE M.COD_COMUNA = 1 AND M.COD_INSTANCIA BETWEEN 1 AND 9 AND M.FECHA_DEMANDA BETWEEN '2025-10-01' AND '2025-11-30' AND M.NRO_JUICIO BETWEEN 1 AND 999999999999 AND M.TIPOJUICIO = '';
SELECT M.NRO_JUICIO & '/' M.COD_JURISDICCION, M.COD_COMUNA, M.COD_JURISDICCION AS INSTANCIA, M.COD_INSTANCIA AS JUZGADONRO, M.AÑO_DEMANDA, M.NRO_JUICIO, M.COD_SISTEMA, M.FECHA_DEMANDA, M.MONTO_INICIAL, M.TIPOJUICIO, M.CUIJ_J, J.DESCRIPCION, J.FECHATRAMITEJUIC FROM M10NAPLEG M LEFT JOIN M10ESTJU J ON J.CODCOMUNA = M.COD_COMUNA AND J.JURISDICCION = M.COD_JURISDICCION AND J.INSTANCIA = M.COD_INSTANCIA AND J.ANODEMANDA = M.AÑO_DEMANDA AND J.NROJUICIO = M.NRO_JUICIO LEFT JOIN M10TABCLA T ON T.COD_COMUNA = M.COD_COMUNA AND T.DESCRIPCION = M.COD_INSTANCIA AND T.ANODEMANDA = M.AÑO_DEMANDA AND T.NROJUICIO = M.NRO_JUICIO WHERE M.COD_COMUNA = 1 AND M.COD_INSTANCIA BETWEEN 1 AND 9 AND M.FECHA_DEMANDA BETWEEN '2025-10-01' AND '2025-11-30' AND M.NRO_JUICIO BETWEEN 1 AND 999999999999 AND M.TIPOJUICIO = '';

SELECT RTRIM(CHAR(DECIMAL(M.NRO_JUICIO, 12,0))) || '/' || RTRIM(CHAR(M.COD_JURISDICCION)) AS NRO_JUICIO_COMPLETO, M.COD_COMUNA, M.COD_JURISDICCION AS INSTANCIA, M.COD_INSTANCIA AS JUZGADONRO, M."AÑO_DEMANDA", M.NRO_JUICIO, M.COD_SISTEMA, M.FECHA_DEMANDA, M.MONTO_INICIAL, M.TIPOJUICIO, M.CUIJ_J, J.DESCRIPCION, J.FECHATRAMITEJUIC FROM M10NAPLEG M LEFT JOIN M10ESTJU J ON J.CODCOMUNA = M.COD_COMUNA AND J.JURISDICCION = M.COD_JURISDICCION AND J.INSTANCIA = M.COD_INSTANCIA AND J.ANODEMANDA = M."AÑO_DEMANDA" AND J.NROJUICIO = M.NRO_JUICIO LEFT JOIN M10TABCLA T ON T.COD_COMUNA = M.COD_COMUNA AND T.DESCRIPCION = M.COD_INSTANCIA AND T.ANODEMANDA = M."AÑO_DEMANDA" AND T.NROJUICIO = M.NRO_JUICIO WHERE M.COD_COMUNA = 1 AND M.COD_INSTANCIA BETWEEN 1 AND 9 AND M.FECHA_DEMANDA BETWEEN DATE('2025-10-01') AND DATE('2025-11-30') AND M.NRO_JUICIO BETWEEN 1 AND 999999999999 AND (M.TIPOJUICIO = '' OR M.TIPOJUICIO IS NULL);
SELECT COD_COMUNA, COD_JURISDICCION AS INSTANCIA, COD_INSTANCIA AS JUZGADONRO, AÑO_DEMANDA, NRO_JUICIO, COD_SISTEMA, FECHA_DEMANDA, MONTO_INICIAL, TIPOJUICIO, CUIJ_J FROM M10NAPLEG WHERE COD_COMUNA = 1 AND COD_INSTANCIA BETWEEN 1 AND 9 AND FECHA_DEMANDA BETWEEN '2025-10-01' AND '2025-11-30' AND NRO_JUICIO BETWEEN 1 AND 999999999999 AND TIPOJUICIO = '';
SELECT * FROM M10TABCLA WHERE COD_COMUNA = ? AND DESCRIPCION BETWEEN 1 AND 9 AND NROJUICIO BETWEEN 1 AND 999999999999 AND ANODEMANDA BETWEEN 2025 AND 2025;
